export function add02(a: number, b: number): number {
  return a + b;
}

export function subtract02(a: number, b: number): number {
  return a - b;
}

export function multiply02(a: number, b: number): number {
  return a * b;
}

export function divide02(a: number, b: number): number {
  return a / b;
}
